import React from "react";
import image1 from "../Img/Img3.jpg";
import MainLayout from "../Layouts/MainLayout";
import "../CSS/BlogPage.css";
import Banner from "../Components/Banner";
const blogPage = () => {
  return (
    <MainLayout>
      <div className="BpMainWrapper">
      <div className="App">
      <Banner type="default" text="Welcome to our website!" />
      <Banner
        type="image"
        image="image-url.jpg"
        text="Discover our amazing products."
      />
      <Banner
        type="gradient"
        text="Special offer: 20% off on all items!"
      />
      <Banner
        type="cta"
        text="Limited time offer. Grab it now!"
        buttonText="Shop Now"
      />
      <Banner
        type="full-width"
        image="background-image.jpg"
        text="Explore our beautiful website."
      />
    </div>
        <h1>BlogPage</h1>
        <p>Test paragraph</p>
        {/* <img src={image1} alt="" /> */}
      </div>
    </MainLayout>
  );
};
export default blogPage;
